import React from 'react';
import City from './City.js';
import data from '../assets/json/data.js';

class SecondContent extends React.Component {
    constructor() {
        super();
        this.one = this.getRandomCity().image;
        this.two = this.getRandomCity().image;
        this.three = this.getRandomCity().image;
        this.four = this.getRandomCity().image;
    }

    createTable() {
        console.log(1);
        return "loading";
    }

    getRandomCity() {
        const current = data[Math.floor(Math.random() * data.length)];
        return current;
    }

    render() {
        return (
            <div className="content2">
                <h5 className="city_header">Popular MYtineraries</h5>
                <ul className="cities">
                    {this.createTable()}
                </ul>
            </div>
        );
    }
}

export default SecondContent;
